import React from "react";
import { useSelector } from "react-redux";
import { Link, NavLink } from "react-router-dom";

export default function Header() {
  const cart = useSelector((state) => state.cart);
  const { cartItems } = cart;

  const userSignin = useSelector((state) => state.userSignin);
  const { userInfo } = userSignin;
  // const dispatch = useDispatch();
  // const signoutHandler = () => {
  //     dispatch(signout());
  // };

  return (
    <header>
      <nav className="navbar">
        <div className="max-width">
          <div className="logo">
            <h2>Yanet's Brides</h2>
          </div>
          <ul className="menu">
            {/* <li><a href="#"><i class="fa fa-search" aria-hidden="true"></i></a></a></li> */}
            <li>
              <NavLink to="/home" activeClassName="active">
                Home
              </NavLink>
            </li>
            <li>
              <NavLink to="/dress" activeClassName="active">
                Dresses
              </NavLink>
            </li>
            <li>
              <NavLink to="/shoe" activeClassName="active">
                Shoes
              </NavLink>
            </li>
            <li>
              <NavLink to="/accessory" activeClassName="active">
                Accessories
              </NavLink>
            </li>
            <li>
              <NavLink to="/plan" activeClassName="active">
                Planning
              </NavLink>
            </li>
            {/* <li>
              <Link to="/products" className="primary">
                All Products
              </Link>
            </li> */}
          </ul>

          <div className="cart">
            <Link to="/cart">
              <i class="fas fa-shopping-basket"></i>
              {cartItems.length > 0 && (
                <span className="badge">{cartItems.length}</span>
              )}
            </Link>
          </div>
          <ul className="sign-in dropdown">
            {userInfo ? (
              <div className="">
              <Link to="#">
                {userInfo.name}
                <i className="fa fa-caret-down"></i>
              </Link>
              </div>
            ) : (
              <Link to="/signin">Sign In</Link>
            )}
          </ul>
        </div>
      </nav>
    </header>
  );
}
